import {BrowserRouter as Router, Route, Switch} from 'react-router-dom';
import SignUp from './components/SignUp';
import SignIn from './components/SignIn';


function App() {
  return (
    <div className='App'>
      <Router>
        <Switch>
          <Route path="/" component={SignUp}/>
          <Route path="/signin" component={SignIn}/>
        </Switch>
      </Router>
    </div>
  );
}

export default App;
